    {...props}
    >

<div className='cardHeader'>
  {props.headerLeft && <div>{props.headerLeft}&#8358</div>  }
  {props.headerRight && <div>{props.headerRight}</div>  }
  </div>
        {props.children}
    </div>
   )

 }

